import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { Form, Button, Row, Col, InputGroup } from "react-bootstrap";
import { login } from "../actions/userActions";
import Message from "../components/Message";
import "./login-register.css";

export default function LoginPage({ history }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [showPwd, setShowPwd]   = useState(false);

  const dispatch = useDispatch();
  const { error, userInfo, loading } = useSelector((s) => s.userLoginReducer || {});

  useEffect(() => {
    if (userInfo) history.push("/");
  }, [userInfo, history]);

  const submitHandler = (e) => {
    e.preventDefault();
    dispatch(login(username, password));
  };

  return (
    <div className="auth-wrap">
      <div className="auth-bg" />

      <Row className="justify-content-md-center auth-row">
        <Col xs={12} md={7} lg={5}>
          <div className="auth-card">
            <div className="auth-brand">
              <img src="/brand/logob.svg" alt="Beauty Shop" />
            </div>

            <h1 className="auth-title">Welcome back</h1>
            <p className="auth-sub">Sign in to continue your beauty journey.</p>

            {error && <Message variant="danger">{error}</Message>}

            <Form onSubmit={submitHandler} className="auth-form">
              <Form.Group controlId="username" className="mb-3">
                <Form.Label>Username</Form.Label>
                <Form.Control
                  size="lg"
                  type="text"
                  placeholder="Enter your username"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                />
              </Form.Group>

              <Form.Group controlId="password" className="mb-3">
                <Form.Label>Password</Form.Label>
                <InputGroup size="lg">
                  <Form.Control
                    type={showPwd ? "text" : "password"}
                    placeholder="Enter your password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                  <Button
                    variant="outline-secondary"
                    onClick={() => setShowPwd((v) => !v)}
                    className="auth-eye"
                    aria-label={showPwd ? "Hide password" : "Show password"}
                  >
                    <i className={`fas fa-eye${showPwd ? "-slash" : ""}`} />
                  </Button>
                </InputGroup>
              </Form.Group>

              <div className="d-flex justify-content-between align-items-center mb-4">
                <Form.Check type="checkbox" label="Remember me" />
                <Link className="auth-link" to="/forgot-password">Forgot password?</Link>
              </div>

              <Button
                type="submit"
                className="auth-submit"
                size="lg"
                disabled={loading}
              >
                {loading ? "Signing in…" : "Sign In"}
              </Button>
            </Form>

            <div className="auth-divider"><span>or</span></div>

            <div className="auth-alt">
              <Button variant="light" className="auth-alt-btn">
                <i className="fab fa-google me-2" /> Continue with Google
              </Button>
              <Button variant="light" className="auth-alt-btn">
                <i className="fab fa-facebook me-2" /> Continue with Facebook
              </Button>
            </div>

            <div className="auth-meta">
              Don’t have an account?{" "}
              <Link to="/register" className="auth-link">Create one</Link>
            </div>
          </div>
        </Col>
      </Row>
    </div>
  );
}
